import { useState, useEffect } from "react";
import { useNavigate, Link } from "react-router-dom";
import API, { apiCall } from "../api/api";

export default function AdminDashboard() {
  const [activeTab, setActiveTab] = useState("overview");
  const [stats, setStats] = useState({
    totalUsers: 0,
    farmers: 0,
    buyers: 0,
    sellers: 0,
    deliveryPartners: 0,
    pendingVerifications: 0,
    totalOrders: 0,
    totalRevenue: 0
  });
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState("");
  const navigate = useNavigate();

  useEffect(() => {
    // Check if admin is logged in
    const adminToken = localStorage.getItem("adminToken");
    if (!adminToken) {
      navigate("/admin/login");
      return;
    }

    fetchDashboardData();
  }, [navigate]);

  const fetchDashboardData = async () => {
    try {
      const { data } = await apiCall(() => API.get("/admin/dashboard-stats"));
      if (data) {
        setStats(data);
      }
    } catch (error) {
      console.error("Error fetching admin dashboard data:", error);
      setError("Failed to fetch dashboard data");
    } finally {
      setLoading(false);
    }
  };

  const handleLogout = () => {
    localStorage.removeItem("adminToken");
    localStorage.removeItem("adminData");
    navigate("/admin/login");
  };

  if (loading) {
    return (
      <div className="container" style={{ paddingTop: "40px", paddingBottom: "40px" }}>
        <div style={{ textAlign: "center" }}>
          <div className="loading-spinner"></div>
          <p>Loading admin dashboard...</p>
        </div>
      </div>
    );
  }

  return (
    <div className="container" style={{ paddingTop: "40px", paddingBottom: "40px" }}>
      <div className="page-header" style={{ marginBottom: "32px" }}>
        <div style={{ display: "flex", justifyContent: "space-between", alignItems: "center" }}>
          <div>
            <h1>ğŸ›¡ï¸ Admin Dashboard</h1>
            <p>KisanSetu Administration Portal</p>
          </div>
          <div style={{ display: "flex", gap: "12px", alignItems: "center" }}>
            <span style={{ color: "var(--text-secondary)" }}>
              Welcome, Admin
            </span>
            <button
              onClick={handleLogout}
              className="btn btn-secondary"
              style={{ fontSize: "14px", padding: "8px 16px" }}
            >
              ğŸšª Logout
            </button>
          </div>
        </div>
      </div>

      {error && <div className="error-message" style={{ marginBottom: "16px" }}>{error}</div>}

      {/* Tab Navigation */}
      <div style={{ 
        borderBottom: "2px solid var(--border-color)", 
        marginBottom: "32px" 
      }}>
        <div style={{ display: "flex", gap: "0", overflowX: "auto" }}>
          {[
            { id: "overview", label: "ğŸ“Š Overview", icon: "ğŸ“Š", path: "/admin/dashboard" },
            { id: "production", label: "ğŸŒ¾ Production", icon: "ğŸŒ¾", path: "/admin/production-verification" },
            { id: "delivery", label: "ğŸšš Delivery Partners", icon: "ğŸšš", path: "/admin/delivery-verification" },
            { id: "users", label: "ğŸ‘¥ Users", icon: "ğŸ‘¥", path: "/admin/user-management" },
            { id: "orders", label: "ğŸ“¦ Orders", icon: "ğŸ“¦", path: "/admin/order-management" },
            { id: "analytics", label: "ğŸ“ˆ Analytics", icon: "ğŸ“ˆ", path: "/admin/analytics" }
          ].map((tab) => (
            <Link
              key={tab.id}
              to={tab.path}
              style={{
                padding: "12px 24px",
                border: "none",
                background: activeTab === tab.id ? "var(--primary-blue)" : "transparent",
                color: activeTab === tab.id ? "white" : "var(--text-secondary)",
                borderBottom: activeTab === tab.id ? "3px solid var(--primary-blue)" : "3px solid transparent",
                cursor: "pointer",
                fontSize: "14px",
                fontWeight: "600",
                transition: "all 0.3s ease",
                whiteSpace: "nowrap",
                textDecoration: "none"
              }}
              onMouseEnter={(e) => {
                if (activeTab !== tab.id) {
                  e.target.style.background = "var(--background-alt)";
                }
              }}
              onMouseLeave={(e) => {
                if (activeTab !== tab.id) {
                  e.target.style.background = "transparent";
                }
              }}
            >
              {tab.label}
            </Link>
          ))}
        </div>
      </div>

      {/* Tab Content */}
      {activeTab === "overview" && (
        <>
          {/* Stats Cards */}
          <div style={{ 
            display: "grid", 
            gridTemplateColumns: "repeat(auto-fit, minmax(200px, 1fr))", 
            gap: "16px",
            marginBottom: "32px"
          }}>
            <div className="card" style={{ textAlign: "center", padding: "20px" }}>
              <div style={{ fontSize: "32px", marginBottom: "8px" }}>ğŸ‘¥</div>
              <div style={{ fontSize: "24px", fontWeight: "bold", color: "var(--primary-blue)" }}>
                {stats.totalUsers}
              </div>
              <div style={{ color: "var(--text-secondary)" }}>Total Users</div>
            </div>

            <div className="card" style={{ textAlign: "center", padding: "20px" }}>
              <div style={{ fontSize: "32px", marginBottom: "8px" }}>ğŸŒ¾</div>
              <div style={{ fontSize: "24px", fontWeight: "bold", color: "var(--primary-green)" }}>
                {stats.farmers}
              </div>
              <div style={{ color: "var(--text-secondary)" }}>Farmers</div>
            </div>

            <div className="card" style={{ textAlign: "center", padding: "20px" }}>
              <div style={{ fontSize: "32px", marginBottom: "8px" }}>ğŸ›’</div>
              <div style={{ fontSize: "24px", fontWeight: "bold", color: "var(--primary-orange)" }}>
                {stats.buyers}
              </div>
              <div style={{ color: "var(--text-secondary)" }}>Buyers</div>
            </div>

            <div className="card" style={{ textAlign: "center", padding: "20px" }}>
              <div style={{ fontSize: "32px", marginBottom: "8px" }}>ğŸª</div>
              <div style={{ fontSize: "24px", fontWeight: "bold", color: "var(--primary-purple)" }}>
                {stats.sellers}
              </div>
              <div style={{ color: "var(--text-secondary)" }}>Sellers</div>
            </div>

            <div className="card" style={{ textAlign: "center", padding: "20px" }}>
              <div style={{ fontSize: "32px", marginBottom: "8px" }}>ğŸšš</div>
              <div style={{ fontSize: "24px", fontWeight: "bold", color: "var(--primary-blue)" }}>
                {stats.deliveryPartners}
              </div>
              <div style={{ color: "var(--text-secondary)" }}>Delivery Partners</div>
            </div>

            <div className="card" style={{ textAlign: "center", padding: "20px" }}>
              <div style={{ fontSize: "32px", marginBottom: "8px" }}>â³</div>
              <div style={{ fontSize: "24px", fontWeight: "bold", color: "#ff9800" }}>
                {stats.pendingVerifications}
              </div>
              <div style={{ color: "var(--text-secondary)" }}>Pending Verifications</div>
            </div>

            <div className="card" style={{ textAlign: "center", padding: "20px" }}>
              <div style={{ fontSize: "32px", marginBottom: "8px" }}>ğŸ“¦</div>
              <div style={{ fontSize: "24px", fontWeight: "bold", color: "var(--primary-green)" }}>
                {stats.totalOrders}
              </div>
              <div style={{ color: "var(--text-secondary)" }}>Total Orders</div>
            </div>

            <div className="card" style={{ textAlign: "center", padding: "20px" }}>
              <div style={{ fontSize: "32px", marginBottom: "8px" }}>ğŸ’°</div>
              <div style={{ fontSize: "24px", fontWeight: "bold", color: "var(--primary-green)" }}>
                â‚¹{stats.totalRevenue}
              </div>
              <div style={{ color: "var(--text-secondary)" }}>Total Revenue</div>
            </div>
          </div>

          {/* Quick Actions */}
          <div className="card">
            <h3 style={{ marginBottom: "16px" }}>ğŸš€ Quick Actions</h3>
            <div style={{ display: "flex", gap: "12px", flexWrap: "wrap" }}>
              <Link
                to="/admin/production-verification"
                className="btn btn-primary"
                style={{ fontSize: "14px", padding: "10px 20px" }}
              >
                ğŸŒ¾ Production Verification
              </Link>
              <Link
                to="/admin/delivery-verification"
                className="btn btn-primary"
                style={{ fontSize: "14px", padding: "10px 20px" }}
              >
                ğŸšš Delivery Partner Verification
              </Link>
              <Link
                to="/admin/user-management"
                className="btn btn-secondary"
                style={{ fontSize: "14px", padding: "10px 20px" }}
              >
                ğŸ‘¥ User Management
              </Link>
              <Link
                to="/admin/order-management"
                className="btn btn-secondary"
                style={{ fontSize: "14px", padding: "10px 20px" }}
              >
                ğŸ“¦ Order Management
              </Link>
            </div>
          </div>
        </>
      )}

      {activeTab === "production" && (
        <div className="card">
          <h3 style={{ marginBottom: "16px" }}>ğŸŒ¾ Production Verification</h3>
          <div style={{ 
            height: "400px", 
            background: "var(--background-alt)", 
            borderRadius: "8px", 
            display: "flex", 
            alignItems: "center", 
            justifyContent: "center",
            flexDirection: "column"
          }}>
            <div style={{ fontSize: "48px", marginBottom: "16px" }}>ğŸŒ¾</div>
            <p style={{ color: "var(--text-secondary)", textAlign: "center", marginBottom: "16px" }}>
              Production verification system
            </p>
            <p style={{ fontSize: "14px", color: "var(--text-secondary)", textAlign: "center", marginBottom: "16px" }}>
              Verify and approve farmer production requests
            </p>
            <Link
              to="/admin/production-verification"
              className="btn btn-primary"
              style={{ fontSize: "14px", padding: "8px 16px" }}
            >
              ğŸŒ¾ Open Production Verification
            </Link>
          </div>
        </div>
      )}

      {activeTab === "delivery" && (
        <div className="card">
          <h3 style={{ marginBottom: "16px" }}>ğŸšš Delivery Partner Verification</h3>
          <div style={{ 
            height: "400px", 
            background: "var(--background-alt)", 
            borderRadius: "8px", 
            display: "flex", 
            alignItems: "center", 
            justifyContent: "center",
            flexDirection: "column"
          }}>
            <div style={{ fontSize: "48px", marginBottom: "16px" }}>ğŸšš</div>
            <p style={{ color: "var(--text-secondary)", textAlign: "center", marginBottom: "16px" }}>
              Delivery partner verification system
            </p>
            <p style={{ fontSize: "14px", color: "var(--text-secondary)", textAlign: "center", marginBottom: "16px" }}>
              Review and approve delivery partner applications
            </p>
            <Link
              to="/admin/delivery-verification"
              className="btn btn-primary"
              style={{ fontSize: "14px", padding: "8px 16px" }}
            >
              ğŸšš Open Delivery Verification
            </Link>
          </div>
        </div>
      )}

      {activeTab === "users" && (
        <div className="card">
          <h3 style={{ marginBottom: "16px" }}>ğŸ‘¥ User Management</h3>
          <div style={{ 
            height: "400px", 
            background: "var(--background-alt)", 
            borderRadius: "8px", 
            display: "flex", 
            alignItems: "center", 
            justifyContent: "center",
            flexDirection: "column"
          }}>
            <div style={{ fontSize: "48px", marginBottom: "16px" }}>ğŸ‘¥</div>
            <p style={{ color: "var(--text-secondary)", textAlign: "center", marginBottom: "16px" }}>
              Complete user management system
            </p>
            <p style={{ fontSize: "14px", color: "var(--text-secondary)", textAlign: "center", marginBottom: "16px" }}>
              Manage all platform users, permissions, and accounts
            </p>
            <Link
              to="/admin/user-management"
              className="btn btn-primary"
              style={{ fontSize: "14px", padding: "8px 16px" }}
            >
              ğŸ‘¥ Open User Management
            </Link>
          </div>
        </div>
      )}

      {activeTab === "orders" && (
        <div className="card">
          <h3 style={{ marginBottom: "16px" }}>ğŸ“¦ Order Management</h3>
          <div style={{ 
            height: "400px", 
            background: "var(--background-alt)", 
            borderRadius: "8px", 
            display: "flex", 
            alignItems: "center", 
            justifyContent: "center",
            flexDirection: "column"
          }}>
            <div style={{ fontSize: "48px", marginBottom: "16px" }}>ğŸ“¦</div>
            <p style={{ color: "var(--text-secondary)", textAlign: "center", marginBottom: "16px" }}>
              Order management system
            </p>
            <p style={{ fontSize: "14px", color: "var(--text-secondary)", textAlign: "center", marginBottom: "16px" }}>
              Monitor and manage all platform orders
            </p>
            <Link
              to="/admin/order-management"
              className="btn btn-primary"
              style={{ fontSize: "14px", padding: "8px 16px" }}
            >
              ğŸ“¦ Open Order Management
            </Link>
          </div>
        </div>
      )}

      {activeTab === "analytics" && (
        <div className="card">
          <h3 style={{ marginBottom: "16px" }}>ğŸ“ˆ Analytics</h3>
          <div style={{ 
            height: "400px", 
            background: "var(--background-alt)", 
            borderRadius: "8px", 
            display: "flex", 
            alignItems: "center", 
            justifyContent: "center",
            flexDirection: "column"
          }}>
            <div style={{ fontSize: "48px", marginBottom: "16px" }}>ğŸ“ˆ</div>
            <p style={{ color: "var(--text-secondary)", textAlign: "center", marginBottom: "16px" }}>
              Analytics dashboard
            </p>
            <p style={{ fontSize: "14px", color: "var(--text-secondary)", textAlign: "center", marginBottom: "16px" }}>
              View detailed platform analytics and reports
            </p>
            <Link
              to="/admin/analytics"
              className="btn btn-primary"
              style={{ fontSize: "14px", padding: "8px 16px" }}
            >
              ğŸ“ˆ Open Analytics
            </Link>
          </div>
        </div>
      )}
    </div>
  );
}
